import React from 'react';
import Navbar,{ CustomFooter } from './components/Navbar' ;
import About from './components/About' ;
import Contact from './components/Contact' ;
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";



function App() {
  return (
    <div className="App">
      <Navbar brandname='ReactRouter'/>
      <div className="row center-align">
        <div className="col s12 main-column"> 
          <h3 className="">Hello World </h3>
        </div>

        <div className="col s6 left-column"> 
          <h3>left World </h3>
        </div>

        <div className="col s6 right-column"> 
          <h3>Right World </h3>
        </div>
       </div>
       <CustomFooter brandname='ReactRouter.com' />
    </div>
  );
}

export default App;
